import React from 'react';
import PokemonGif from './PokemonGif';

class Pokemon extends React.Component {
  render() {
    const { name, type, averageWeight } = this.props.pokemon;
    return (
      <div>
        <p>Name: {name}</p>
        <p>Type: {type}</p>
        <p>Average weight: {averageWeight}</p>
        <PokemonGif />
      </div>
    )
  }
}

export default Pokemon;
